import React from 'react';
import './App.css';
import teamsJson from './teams.json';

const teamsList = teamsJson

class Team extends React.Component < {school:string, name:string, city:string, state:string} >{
  render() {
    const oneTeam = this.props;
    return(
      <div>
        <h2>{oneTeam.school}</h2>
        <p>Mascot: {oneTeam.name}</p>
        <p>Location: {oneTeam.city}, {oneTeam.state}</p>
      </div>
    );
  }
}

function TeamList() {
  return (
    <div>
      <Team {...teamsList["teams"][0]} />
    </div>
  )
}

function Header() {
  return (<h1>NCAA Baskeball Teams</h1>);
}

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Header/>
      </header>
      <body>
        <TeamList/>
      </body>
    </div>
  );
}

export default App;
